 import React from 'react';
 import logo from './logo.svg';
 import  { Toolbar, AppBar } from '@material-ui/core';
 import './App.css';


function Body() {
  return (
    <React.Fragment>
      <div className="Body">
      <h1 className={["Header", "Title"].join(" ")}>Taiyaki</h1>
      </div>
    </React.Fragment>
  );
}

function LogoView() {
  return (
    <React.Fragment>
      <div className="Logo-view">
        <img src={logo} className="Logo" alt="logo"/>
      </div>
      <Body/>
    </React.Fragment>
  );
}




function App() {
  return (
   <React.Fragment>
   <div className="App">
   <header className="App-header">
   <AppBar position="fixed">
     <Toolbar className="Tool-bar">{
       <h1 className={["Header", "Roboto"].join(" ")}>Taiyaki</h1>
     }</Toolbar>
   </AppBar>
   </header>
   <LogoView/>

   </div>
   </React.Fragment>
  )
}

export default App;

